; /* Start:"a:4:{s:4:"full";s:58:"/local/templates/kdelo_landing/js/script.js?16723953944286";s:6:"source";s:43:"/local/templates/kdelo_landing/js/script.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
document.addEventListener('DOMContentLoaded', () => {
    //Animation
    function makeAnimation(container, path) {
        lottie.loadAnimation({
            container: document.querySelector(container), // the dom element that will contain the animation
            renderer: 'svg',
            loop: true,
            autoplay: true,
            path: path // the path to the animation json
        });
    }
    makeAnimation('.promo__img', '/test_landing_page/js/animation1.json');
    makeAnimation('.more-selling__item', '/test_landing_page/js/animation2.json');
    makeAnimation('.how-much__item', '/test_landing_page/js/animation3.json');
    makeAnimation('.modal-section__item', '/test_landing_page/js/animation4/animation4.json');

    //Mask for modal
    $(document).ready(function () {
        $('input[name=phone]').mask("+7 (999)-999-99-99");
    });

    new WOW(
    {
        boxClass:     'wow',      // default
        animateClass: 'animate__animated', // default
        offset:       0,          // default
        mobile:       true,       // default
        live:         true        // default
      }).init();

    //Projects part

    const projectsBoxs = document.querySelectorAll('.projects__box');
    const projectItem = document.querySelector('.project-item');
    const projectItemImg = document.querySelectorAll('.project-item__img');
    const close = document.querySelectorAll('.close');
    const body = document.querySelector('body');

	Fancybox.defaults.Toolbar = {display:($(window).width() < 768 ? ["close"] : [])};
	Fancybox.defaults.Image = { zoomOpacity:0.7, zoom: true, fit: ($(window).width() < 768 ? "contain" : "contain-w"), display:["close"],};
	$('.projects__box').on('click', function(){
		var img = $(this).data('img');

		Fancybox.show([
		  {
			src: img,
			type: "image",
		  },
		]);

		return false;
	});

    // projectsBoxs.forEach((projectsBox, i) => {
        // projectsBox.addEventListener('click', () => {
            // body.style.overflow = 'hidden';
            // projectItem.classList.remove('hide');
            // projectItemImg.forEach(img => {
                // img.classList.add('hide');
            // });
            // projectItemImg[i].classList.remove('hide');
        // });
        // close.forEach(i => {
            // i.addEventListener('click', () => {
                // body.style.overflow = 'auto';
                // projectItem.classList.add('hide');
            // });
        // });
            // projectItem.addEventListener('click', (e) => {
                // if(e.target == projectItem){
                    // body.style.overflow = 'auto';
                    // projectItem.classList.add('hide');
                // }
            // });
    // });
});

$(function(){
	$('.lazy').Lazy();
    $(window).on('scroll', function(){
        if($(window).scrollTop() < 10){
            $('.header').removeClass('__scroll');
        }
        else{
            $('.header').addClass('__scroll');
        }
    })

    if($(window).scrollTop() > 0){
        $('.header').addClass('__scroll');
    }

	$("#formRequest").validate({
		errorElement: 'span',
		errorClass: 'error-msg',
		rules: {
			name: "required",
			phone: "required",
			email: {
				required: true,
				email: true
			}
		},
		highlight: function( element ){
			$( element ).addClass( 'error-field' );
		},
		unhighlight: function( element ){
			$( element ).removeClass( 'error-field' );
		},
		submitHandler: function( form ){
			var formData = $(form).serialize();
			$.ajax({
                url: "/ajax/landing_req.php",
                type: "POST",
                data: formData,
                async: false,
                success: function (data) {

					form.reset();

                    $(".modal-success").css("display", "flex");
                },
            });
		},
		errorPlacement: function( error, element ){
		},
	});
  $('.feed-form').submit(function (e){
      e.preventDefault();
      $.ajax({
          url: "/ajax/landing_req.php",
          method: 'POST',
          data: $(this).serialize(),
          success: function (data) {
              $('.thanks_form').show();
          }
      });
  })

  $('.close_thanks').click(function(){
      $(this).parents('.thanks_form').hide();
  })
})

/* End */
;
